// src/components/Navbar.js
import React from 'react';

const Navbar = ({ onCallForHelp }) => {
  return (
    <div class="nav-bar">
      <h2>PWET NI ALBERT</h2>
      <button className="nav-button" onClick={onCallForHelp}>Call for Help</button>
    </div>
  );
};

export default Navbar;
